// import AppPatient from "./patient/AppPatient";
// import AppDoctor from "./doctor/AppDoctor";
// import ErrPage from "../../components/common-doctor-patient/err/ErrPage";

// import crypto from "crypto-js";

// import { Navigate, Outlet } from "react-router-dom";
import Home from "../../component/Home";

function PrivateRoute() {
  const token = localStorage.getItem("token");
  if (token) {
    const role = localStorage.getItem("role");
    var bytes = crypto.AES.decrypt(role, "role");
    var role_decode = bytes.toString(crypto.enc.Utf8);
  }
  return <Home />;
}

export default PrivateRoute;
